import React from 'react'
import Ticker from 'react-ticker'
import '../assets/css/videoFooter.css'

function VideoFooter({channel, description, song}) {
    return (
        <Ticker className="ticker" mode="smooth">
                    {({ index }) => (
                        <>
                            <p>{song}</p>
                        </>
                    )}
                </Ticker>
    )
}

export default VideoFooter
